import Colaborador from '../Colaborador'
import './time.css'

const Time = (props) => {
    return(
        
        <section className='time' style={{backgroundColor: props.corSecundaria}}>
            <h3 style={{borderColor: props.corPrimaria}}>{props.nome}</h3>
            {props.colaboradores.map(colaborador => <Colaborador nome={colaborador.nome} cargo={colaborador.cargo} imagem/>)}
        </section>
    )
}

export default Time
